          spaceBetween={30}
          slidesPerView={3}
          grabCursor={true}
          className="portfolio-slider"
        >
          <SwiperSlide>
            <img src={Sidebar} alt="" />
          </SwiperSlide>
          {/* <SwiperSlide>
            <img src={Ecommerce} alt="" />
          </SwiperSlide>
          <SwiperSlide>
            <img src={MusicApp} alt="" />
          </SwiperSlide> */}
          <SwiperSlide>
            <img src={HOC} alt="" />
          </SwiperSlide>
        </Swiper>
      </div>

  );
}

export default Portfolio
